scriptlet.script:
var split = scriptletInput.split(/value=((?:".*")|(?:\w+))/i);
if (split.length>1)
	scriptletResult = split[1];
else{
split = scriptletInput.split(/<option(?:(?:[^>,"]*)|(?:"[^"]*?"))*selected(?:(?:[^>,"]*)|(?:"[^"]*?"))*>(.+?)(<\/option|<option|$)/i);
if (split.length >3)
	scriptletResult = split[1];
else
	scriptletResult = "";
}
